public boolean equals(Object o) {
  if (this == o) {
    return true;
  }
  if (!(o instanceof FlowActivitySubDoc)) {
    return false;
  }
  FlowActivitySubDoc m = (FlowActivitySubDoc) o;
  if (!flowVersion.equalsIgnoreCase(m.getFlowVersion())) {
    return false;
  }
  return flowRunId == m.getFlowRunId();
}
